#include<iostream>
#include<vector>
#include<gmpxx.h>
using namespace std;
using z=mpz_class;
using vi=vector<int>;
int main(){
  z N = _mpz;
  z sN = _mpz;
  z m = sN - sN / 100000000;
  z M = sN + sN / 100000000;
  vi x;
  for (int i = 2; i <= 331; i++)
    while((N % i) == 0){
      N /= i;
      x.push_back(i);
    }
  while(1) {
    random_shuffle(x.begin(), x.end());
    z p(1);
    for (int f:x) {
      p *= f;
      if (p > M) break;
      if (p >= m) {
        cout << p << "\n";
        return 0;
      }
    }
  }
}
